import GayBilly from '../assets/img/977.jpg';
import '../scss/MainEpt.scss';

export function Menu() {
    return (
        <div className="stylesept">
            <div className="BillyGayTlo"><img src={GayBilly} alt="Тло профілю" style={{display:flex,alignItems:'center'}}/>
            <img src={GayBilly} alt="Тло профілю" style={{borderRadius:"50%",height:207,width:207,overflow:'hidden',objectFit:'cover'}} />
            </div>   
            <div></div>  
            <div></div>  
        </div>
    )
}
